import React from 'react';
import Login from './pages/Login/login.js';
import './App.css'
import { BrowserRouter,Route,Routes} from 'react-router-dom';


function App() {
  return (
    <BrowserRouter>
      <Routes>
        <Router>
          <Route exact path="/" element={<Login></Login>}></Route>
        </Router>
      </Routes>
    </BrowserRouter>
  );
}

export default App;
